import React from 'react';
import { Nav } from 'react-bootstrap';
import NavBar from './Nav';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

const Lemmikud = ({ people, isLiked, removeFromFavorites }) => {
    return (
        <div className="container">
            <h2>Liked Items:</h2>
            {isLiked.length > 0 && (
                <div className="row">
                    {isLiked.map((person, index) => (
                        <div className="col-md-4 mb-3" key={index}>
                            <div className="card">
                                <img src={person.picture instanceof File ? URL.createObjectURL(person.picture) : person.picture} className="card-img-top" />
                                <div className="card-body">
                                    <h5 className="card-title">{person.name}</h5>
                                    <p className="card-text">Phone: {person.phone}</p>
                                    <p className="card-text">Education: {person.education}</p>
                                    <button
                                        style={{
                                            backgroundColor: '#FF8A80',
                                            color: '#f8f9fa',
                                            border: '1px solid #343a40',
                                            marginRight: '10px',
                                            padding: '6px 12px',
                                            textAlign: 'center',
                                            textDecoration: 'none',
                                            display: 'inline-block',
                                            fontSize: '16px',
                                            borderRadius: '4px',
                                            cursor: 'pointer',
                                            margin: '3px'
                                        }}
                                        onClick={() => removeFromFavorites(person.id)}
                                    >
                                        Remove Item
                                    </button>
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
            )}
            {isLiked.length === 0 && <p>No likes</p>}
        </div>
    );
}

export default Lemmikud;
